import { library } from '@fortawesome/fontawesome-svg-core';

import {
  faGithubAlt,
  faGoogle,
  faFacebook,
  faTwitter
} from '@fortawesome/free-brands-svg-icons';

library.add(
  faGithubAlt,
  faGoogle,
  faFacebook,
  faTwitter
);
